import React from 'react';
import {Container, 
    Row,
    Col
} from 'reactstrap'
import bgpj1 from './img/bg-pj1.jpg'

export default class Page3 extends React.Component {
    render() {
        return (
            <div className="divpage3">
                <Container className="containerpage3">
                    <Row>
                        <Col>
                            <img src={bgpj1} alt="bgimg-project1"/>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}
